import "./Navbar.css";

function Navbar() {
	return (
		<div className="Navbar">
			<button className="NavBarButton">button</button>
			<button className="NavBarButton">Website</button>
			<button className="NavBarCart">cart</button>
		</div>
	);
}

export default Navbar;
